window.debugImagePaths = function() {
    console.log("=== Image Path Debug ===");
    const keys = Object.keys(imagesByPageKey);
    console.log("Total page keys:", keys.length);

    if (keys.length > 0) {
        const firstKey = keys[0];
        const firstImages = imagesByPageKey[firstKey];
        console.log("Sample page key:", firstKey);
        console.log("Sample images:", firstImages);

        if (firstImages && firstImages.length > 0) {
            console.log("Testing first image...");
            const testImg = new Image();
            testImg.onload = () => console.log("✓ Image loads successfully:", firstImages[0]);
            testImg.onerror = () => console.log("✗ Image failed to load:", firstImages[0]);
            testImg.src = firstImages[0];
        }
    }
};
